// src/App.tsx

import React from 'react';
import './App.css';
import ReviewPieChart from './components/ReviewPieChart';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>A Slice of Pi - Review Analysis</h1>
        <ReviewPieChart />
      </header>
    </div>
  );
}

export default App;
